// Painel de estatísticas e controle
function createControlPanel() {
    const panel = document.createElement('div');
    panel.id = 'controlPanel';
    panel.style = `
        position: fixed;
        top: 10px;
        right: 10px;
        background: white;
        border: 1px solid black;
        padding: 10px;
        z-index: 1000;
        width: 250px;
        font-family: Arial, sans-serif;
        font-size: 12px;
    `;

    panel.innerHTML = `
        <h3>Painel do Bot</h3>
        <p>Status: <span id="status">Stopped</span></p>
        <p>Modelo LSTM: <span id="lstmStatus">Não Carregado</span></p>
        <p>Saldo Atual: <span id="balance">0.00000000 BTC</span></p>
        <p>Vitórias: <span id="wins">0</span></p>
        <p>Derrotas: <span id="losses">0</span></p>
        <p>Lucro Total: <span id="profit">0.00000000 BTC</span></p>
        <p>Taxa de Vitórias: <span id="winRate">0.00%</span></p>
        <button id="startButton">Iniciar</button>
        <button id="stopButton">Parar</button>
    `;

    document.body.appendChild(panel);

    document.getElementById("startButton").onclick = startBot;
    document.getElementById("stopButton").onclick = stopBot;
}

// Variáveis globais
let isRunning = false;
let wins = 0;
let losses = 0;
let profit = 0.0;
let balance = 0.00000000;
let modelLoaded = false;
let model;

// Função para atualizar o painel
function updatePanel() {
    document.getElementById("status").textContent = isRunning ? "In Progress" : "Stopped";
    document.getElementById("lstmStatus").textContent = modelLoaded ? "Carregado" : "Não Carregado";
    document.getElementById("balance").textContent = `${balance.toFixed(8)} BTC`;
    document.getElementById("wins").textContent = wins;
    document.getElementById("losses").textContent = losses;
    document.getElementById("profit").textContent = `${profit.toFixed(8)} BTC`;
    const winRate = (wins / (wins + losses)) * 100 || 0;
    document.getElementById("winRate").textContent = `${winRate.toFixed(2)}%`;
}

// Função de inicialização do bot
async function startBot() {
    if (isRunning) return;
    isRunning = true;

    if (!modelLoaded) {
        model = await loadEmbeddedModel();
        if (model) modelLoaded = true;
    }

    while (isRunning) {
        const prediction = Math.random() > 0.5 ? "hi" : "lo"; // Substitua isso com previsões reais do modelo
        const result = Math.random() > 0.5; // Simule um resultado de aposta
        if (result) {
            wins++;
            profit += 0.00000001; // Simule um ganho
        } else {
            losses++;
            profit -= 0.00000001; // Simule uma perda
        }
        updatePanel();
        await new Promise((resolve) => setTimeout(resolve, 2000)); // Aguarde 2 segundos
    }
}

// Função para parar o bot
function stopBot() {
    isRunning = false;
    updatePanel();
}

// Inicializar o painel ao carregar a página
window.addEventListener("load", createControlPanel);
